import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PlayerPicksPage from './components/PlayerPicksPage';
import AdminPicksPage from './components/AdminPicksPage';
import ResultsPage from './components/ResultsPage'; // Make sure this path matches your folder

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PlayerPicksPage />} />
        <Route path="/admin" element={<AdminPicksPage />} />
        <Route path="/results" element={<ResultsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
